import React, { useContext } from 'react'
import { counterContext } from '../../Context/CounterContext'

function Home(props) {
  let {increseCounter} = useContext(counterContext);
    return (
    <div>Home<button className='btn btn-success'onClick={()=>increseCounter(0)}>Increse</button></div>
  )
}

export default Home
